const item = $input.first();
const config = $('Translation Configuration').first().json;

const sourceContent = item.json.content || item.json.text || 'Sample content for translation';
const title = item.json.title || 'Untitled';
const contentId = item.json.id || `content-${Date.now()}`;

return [{
  json: {
    contentId: contentId,
    title: title,
    sourceText: sourceContent,
    sourceLanguage: config.sourceLanguage,
    targetLanguages: config.targetLanguages,
    config: config,
    createdAt: new Date().toISOString()
  }
}];

const item = $input.first();
const sourceData = $('Prepare Source Content').first().json;
const targetLang = $('Split Target Languages').item.json;

const translatedText = item.json.text || item.json.translations?.[0]?.text || '';

return [{
  json: {
    contentId: sourceData.contentId,
    title: sourceData.title,
    sourceLanguage: sourceData.sourceLanguage,
    targetLanguage: targetLang,
    sourceText: sourceData.sourceText,
    translatedText: translatedText,
    characterCount: translatedText.length,
    translatedAt: new Date().toISOString()
  }
}];

