const item = $input.first();
const translationData = $('Format Translation Result').item.json;

let qualityResult;
try {
  const responseText = item.json.output || item.json.text || '';
  const jsonMatch = responseText.match(/\{[\s\S]*\}/);
  qualityResult = jsonMatch ? JSON.parse(jsonMatch[0]) : {
    qualityScore: 0.8,
    accuracyScore: 0.8,
    fluencyScore: 0.8,
    issues: [],
    suggestions: [],
    approved: true,
    summary: 'Default approval - manual review recommended'
  };
} catch (e) {
  qualityResult = {
    qualityScore: 0.7,
    accuracyScore: 0.7,
    fluencyScore: 0.7,
    issues: ['Parse error'],
    suggestions: ['Manual review required'],
    approved: false,
    summary: 'Quality check failed: ' + e.message
  };
}

return [{
  json: {
    ...translationData,
    quality: qualityResult,
    isApproved: qualityResult.approved,
    processedAt: new Date().toISOString()
  }
}];

